            <th>Date</th>
            <th>Roomname</th>
            <th>Time</th>
            <th></th>
          </tr>
        </thead>
        <tbody>
        <TableRows
            rowsData={rowsData}
            deleteTableRows={deleteTableRows}
            handleChange={handleChange}
          />
        </tbody>
      </table>
    </div>
  );
}
